.loading {
    width: 375px;
    height: 655px;
    z-index: 1;
    display: none;
    position: absolute;
    background-color: rgba(255, 255, 255, 0.4);
}
.loading.active {
    display: block;
}

.loading::before, .loading::after {
content: '';
width: 10px;
height: 10px;
position: absolute;
top: 0;
left: 0;
right: 0;
bottom: 0;
margin: auto;
border-radius: 50%;
background: black;
animation: loadinging 2s infinite;
}
.loading::after {
animation-delay: 1s;
}

@keyframes loadinging {
0% {
    width: 15px;
    height: 15px;
    opacity: 0.6;
}
100% {
    width: 50px;
    height: 50px;
    opacity: 0;

}
}
